bool tmp[40][40];
bool a[40005][40][40];
int as[40005], cntw[10][10], pref[100][100];
int datai[4000000];

mt19937 rng(chrono::steady_clock::now().time_since_epoch().count());

int randint(int l, int r){
    return uniform_int_distribution <int> (l, r) (rng);
}

int get(int i2, int j2, int i, int j){
    --i2; --j2;
    int ans = 0;
    ans += pref[i][j];
    if (i2 >= 0) ans -= pref[i2][j];
    if (j2 >= 0) ans -= pref[i][j2];
    if (i2 >= 0 && j2 >= 0) ans += pref[i2][j2];

    return ans;
}

void hide(int a, int b){
    for(int i = a; i < a + 10; ++i){
        for(int j = b; j < b + 10; ++j){
            tmp[i][j] = -1;
        }
    }
}

void che(int type){
    if (type == 1){
        int a = randint(0, 30), b = randint(0, 30);
        hide(a, b);
    } else {
        for(int i = 0; i < 40; ++i){
            for(int j = 0; j < 40; ++j){
                pref[i][j] = tmp[i][j];
                if (i) pref[i][j] += pref[i - 1][j];
                if (j) pref[i][j] += pref[i][j - 1];
                if (i > 0 && j > 0) pref[i][j] -= pref[i - 1][j - 1]; 
            }
        }
        pair<int, pair<int, int>> ma = {-1, {0, 0}};
        for(int i = 0; i <= 30; ++i){
            for(int j = 0; j <= 30; ++j){
                ma = max(ma, {get(i, j, i + 9, j + 9), {i, j}});
            }
        }
        hide(ma.second.first, ma.second.second);
    }
}

void readknn(){
    int p = 0;
    for(char c : dat){
        datai[p] = dat[p];
        if (datai[p] > 92) --datai[p];

        datai[p] -= 39;

        ++p;
    }
	int sum = 0; p = 0;
	int val = datai[0];
	bool tmp = 0;
    for(int t = 0; t < 8000; ++t){
		for(int i = 0; i < 40; ++i){
			for(int j = 0; j < 40; ++j){
				a[t][i][j] = tmp;
				--val; ++sum;
				if (val == 0){
					tmp ^= 1;
					++p;
					val = datai[p];
				}
				if (sum == 80){
                    assert(i % 2 == 1 && j == 39);
					sum = 0;
					tmp = 0;
				}
			}
		}
        as[t] = t / 800;
	}
}

int dis(int t){
    int res = 0;
    for(int i = 0; i < 40; i++){
        for(int j = 0; j < 40; j++){
            //if (tmp[i][j] == -1) continue;
            int w = 80 - (abs(21 - i) + abs(21 - j));
            if (a[t][i][j] != tmp[i][j]) res += w;
            else res -= w;
        }
    }
    return res;
}

int solve(){
    vector <pair<int, int>> v;
    for(int t = 0; t < 8000; ++t){
        v.push_back({dis(t), as[t]});
    }
    sort(v.begin(), v.end());

    int freq[10];
    int best[10];
    memset(freq, 0, sizeof freq);
    fill(best, best + 10, 0);
    
    int K = 1;
    for(int i = 0; i < K; ++i){
        freq[v[i].second] += (K - i);
        best[v[i].second] = max(best[v[i].second], MAXA - i + 1);
    }

    array<int, 3> ma = {-1, -1, 0};
    for(int i = 0; i < 10; ++i){
        ma = max(ma, {freq[i], best[i], i});
    }
    return ma[2];
}

signed main() {
    cin.tie(NULL)->sync_with_stdio(false);

    readknn();

    int ct = 0, lim = 1, unk(0), last = 0;
    for (int i = 0, ans; i < lim; ++i) {

        for(int i = 0; i < 40; ++i){
            for(int j = 0; j < 40; ++j){
                char c; cin >> c;
                tmp[i][j] = (c == '1');
            }
        }

        cout << solve();
    }
    cerr << dat.size();
}
